import './App.css';
import './script';
import React, { useState } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';

function App() {
  const [value, onChange] = useState(new Date());
  return (
    <div className="App">
      <input type="text" placeholder="month day year hour"/>

      <div>
        <Calendar
          onChange={onChange}
          value={value}
        />
      </div>


        <div class="container">
          <h1>CountDown Timer</h1>
          <div id="line"></div>
          <p id="timer"></p>
        </div>
    </div>
  );
}

export default App;
